import React from 'react'
import {useReducer} from 'react-redux'
import {TopHeaderContainer} from "./topHeader/TopHeaderContainer"
import BottomHeader from "./bottomHeader/BottomHeader"
import {Container} from "@material-ui/core"
import {useStyles} from './useStyles'
import {GetStaticProps} from "next";
import {wrapper} from "../../redux/store";


export const Header = (props) => {
    const {header} = props.localization;
    const classes = useStyles();
    return (
        <header className={classes.root}>
            <Container maxWidth="lg">
                <TopHeaderContainer local={header.topHeader}/>
                <div className={classes.bottomHeaderWrapper}>
                    <BottomHeader/>
                </div>
            </Container>
        </header>
    )
};

export const getStaticProps: GetStaticProps = wrapper.getStaticProps(({store}) => {
    const {localization} = store.getState();
    return {
        props: {localization}
    }
});
